var words = raw.split(","); //On stocke les mots dans un tableau en coupant la string à chaque virgule
var wordNumber = words.length; 
var completed = [];
var alphabet = "ABCDEFGHIJKLMNOPQRSTUVWXYZ".split(''); //On stocke l'alphabet dans un tableau en coupant la string entre chaque lettre
var completionColumn = document.getElementById("completion");
var inputWord = document.getElementById("inputWord");
alphabet.forEach(function(letter){ // On crée la ligne de lettre qui se colorerons quand complétées.
    var node = document.createElement("div");
    node.classList.add("letter")
    node.id = "letter"+letter;
    node.innerText = letter;
    completionColumn.appendChild(node);
});

var currentWord = -1;
var word1 = document.getElementById("word1");
var word2 = document.getElementById("word2");
var word3 = document.getElementById("word3");
var word4 = document.getElementById("word4");
var word5 = document.getElementById("word5");

start();

function start() 
{
	document.addEventListener("keyup", nextWordTrigger, false);
	nextWord();
}

function verifyWord() // Verifie si le mot est bien orthographié
{
    if(currentWord !=-1)
    {
		// On change la couleur si le mot actuel (en minuscule ou majuscule) est égal au mot à cet index dans le tableau
        if(words[currentWord].toLowerCase() === inputWord.value || words[currentWord] === inputWord.value)
        {
            word3.style.color = "green";
            return true;
        }
        else
        {
            word3.style.color = "red";
            return false;
        }
    }
}

function nextWord() // On passe au prochain mot
{
    if(verifyWord() && currentWord !=-1) // Si le mot est bien orthographié alors on indique qu'il est complété et on vérifie si sa lettre est complétée.
    {
        completed[currentWord] = true;
        verifyLetterCompletion(inputWord.value[0].toUpperCase());
    }
	// Puis on passe au prochai mot, on reset l'input text et on change les mots précédents et suivants
    currentWord++;
    inputWord.value = "";
    word3.innerText = words[currentWord];
    if(currentWord > 0)
        word2.innerText = words[currentWord-1];
    else
        word2.innerText = '';
    if(currentWord > 1)
        word1.innerText = words[currentWord-2];
    else
        word1.innerText = '';
    if(currentWord < (wordNumber-1))
        word4.innerText = words[currentWord+1];
    else
        word4.innerText = '';
    if(currentWord < (wordNumber-2))
        word5.innerText = words[currentWord+1];
    else
        word5.innerText = '';
}


function verifyLetterCompletion(letter) // vérifie si tout les mots commençant par une lettre ont été écrits/complétés
{
    var index = 0;
    var good = true;
    while(good && words[index].startsWith(letter))
    {
        if(completed[index] === true)
            good = true;
        else
            good = false;
        index++;
    }
    if (good)
        document.getElementById("letter"+letter).style.color = "green";
    else
		document.getElementById("letter"+letter).style.color = "white";
}

//Fonction de recherche pour aller à un mot
function goTo(word) 
{
    var index = words.indexOf(word.toUpperCase());
    if(index !=-1)
    {
        currentWord = index -1;
        nextWord();
    }
}

//Si on appuie sur entrée on va au prochain mot
function nextWordTrigger(e){
    if(e.keyCode == 32 || e.keyCode == 13)
		nextWord();
}
